import React from 'react'
import AddProject from './Components/AddProject'
import AddResource from './Components/AddResource'
import { Link, BrowserRouter } from 'react-router-dom'
import { BrowserRouter as Route} from 'react-router-dom'
import './App.css';

function App() {

  return (

     <BrowserRouter>
       <div>
         <h3 class="Content"> What do you want to do today </h3>
         <BrowserRouter path="/" render={props =>(
           <React.Fragment>
            <AddProject/>
            <AddResource/>
           </React.Fragment>

         )}/>
       <BrowserRouter path="/addproject" component={AddProject}/>
         <Link to="/" class="Content"> Home</Link> <br/> 
         <Link to="/addproject"  class="Content"> AddProject</Link>
      </div>
      </BrowserRouter>
  );
}

export default App;
